B.FF=new A.bb(B.dQ,["e-Inu: Simulating A Quadruped Robot With Emotional Sentience.","Chakravarty, A. et al.","https://arxiv.org/abs/2301.00964",'This paper discusses the understanding and virtual simulation of such a robot capable of detecting and understanding human emotions, generating its gait, and responding via sounds and expression on a screen. To this end, we use a combination of reinforcement learning and software engineering concepts to simulate a quadruped robot that can understand emotions, navigate through various terrains and detect sound sources, and respond to emotions using audio-visual feedback. This paper aims to establish the framework of simulating a quadruped robot that is emotionally intelligent and can primarily respond to audio-visual stimuli using motor or audio response. The emotion detection from the speech was not as performant as ERANNs or Zeta Policy learning, still managing an accuracy of 63.5%. The video emotion detection system produced results that are almost at par with the state of the art, with an accuracy of 99.66%. Due to its "on-policy" learning process, the PPO algorithm was extremely rapid to learn, allowing the simulated dog to demonstrate a remarkably seamless gait across the different cadences and variations. This enabled the quadruped robot to respond to generated stimuli, allowing us to conclude that it functions as predicted and satisfies the aim of this work.'],t.li)
B.FE=new A.bb(B.dQ,["HRV stress analysis using k-NN clustering technique.","Tripathy, J. K. et al.","https://pubs.aip.org/aip/acp/article-abstract/2579/1/020033/2915365/HRV-stress-analysis-using-k-NN-clustering","Human life in the modern scenario has become quite taxing; mental health issues are on the rise. Our medical science may have progressed well enough to furnish physical health excellency in the general populace (of course, in relative terms), but mental health is still taboo. This is especially so in many of the non-first-world countries, where forthcoming mental health issues and asking for help can lead to anything from public ridicule to social ostracism. In such a scenario, it is of paramount importance that someone comes up with a more private approach to mental health care and well-being. In this paper, the authors discuss how the effects of stress can be monitored using a different implementation of k-NN (k-Nearest Neighbors). With this, using the Manhattan distance metric we were able to achieve 99.84% accuracy, and even after the application of PCA, we achieved 93.97% accuracy."],t.li)
B.FD=new A.bb(B.dQ,["Comprehensive analysis of embeddings and pre-training in NLP.","Tripathy, J. K. et al.","https://www.sciencedirect.com/science/article/abs/pii/S1574013721000733","The amount of data and computing power has drastically increased over the last decade, which leads to the development of several new fronts in the field of Natural Language Processing (NLP). In addition to that, the entanglement of embeddings and large pre-trained models have pushed the field forward, covering a wide variety of tasks starting from machine translation to more complex tasks such as contextual text classification. This paper covers the underlying idea behind all embeddings and pre-trained models and provides an insight into fundamental strategies and implementation details of innovative embeddings. Further, it imparts the pros and cons of each specific embedding design and the associated impact on the result. It also comprehends the comparison of all the different strategies, datasets, architectures discussed in different papers with the help of standard metrics used in NLP. The content covered in this review work aims to shed light on different milestones reached in NLP, allowing the reader to deepen their understanding of NLP, which would motivate to explore the field further."],t.li)
B.FG=new A.bb(B.dQ,["ALBERT-based fine-tuning model for cyberbullying analysis.","Tripathy, J. K. et al.","https://link.springer.com/article/10.1007/s00530-020-00690-5","This paper explores some of the recent approaches to the difficulties of contextual understanding and proposes an ALBERT-based fine-tuned model that achieves state-of-the-art results. ALBERT is a transformer-based architecture and thus even at its untrained form provides better contextual understanding than other recurrent units. This coupled with the fact that ALBERT is pre-trained on a large corpus allowing the flexibility to use a smaller dataset for fine-tuning as the pre-trained model already has deep understanding of the complexities of the human language. ALBERT showcases high scores in multiple benchmarks such as the GLUE and SQuAD showing that high levels of contextual understanding are inherently present and thus fine-tuning for the specific case of cyberbullying allows to use this to our advantage. With this approach, we have achieved an F1 score of 95% which surpasses current approaches such as the CNN\u2009+\u2009wordVec, CNN\u2009+\u2009GRU and BERT implementations."],t.li)
B.FH=new A.bb(B.dQ,["Pattern Prediction using LSTM and ReLU Ensemble.","Chakravarty, A. & Tripathy, J. K.","https://papers.ssrn.com/sol3/papers.cfm?abstract_id=3569584","Human beings, like many other cognizant biological organisms, can roughly predict certain patterns in nature, be it with respect to time, or otherwise. In the strive to achieve the global object of achieving a general artificial intelligence, the authors deem it to be of high importance that the intelligence is aware of its surroundings, not just in terms of understanding raw sensory data, but also by learning and being able to predict recurring patterns in the environment. To achieve that result, this paper comes into play by discussing certain neural network models which help in learning from any sort of pattern recognition in a data sequence which can be achieved by either manual input or via data collection from the outer environment. This model is able to predict accurately about 80% of the time, beating state-of-the-art approaches."],t.li)
